<script src="assets/scripts/main.js"></script>
<script>
    function cancelStakingOrder(id){
        $.ajax({
            type: "POST",
            url: "/api/ajax/cancel_staking_order.php",
            data: {
                id: id
            },
            success: function(response) {

                if (response.status == 'success') {
                    location.reload();
                }
            },
            error: function(response) {
                console.log(response)
            }
        });
    }
    const currencyoptions = [
        <?= render_custom_select_coin() ?>

    ];
    const select1 = new ItcCustomSelect("#select-1", {
        options: currencyoptions,
        targetValue: "189_Bitcoin",
        onSelected(select, option) {
            const text = option ? option.textContent : '';
            const id_coin = select.value;
            available_balance_func(id_coin, text)
            const swap_input_coinName = document.getElementById('swap_input_coinName');
            swap_input_coinName.textContent = text;
            active_coin = id_coin.split('_')[1];
            active_coin_s = text;
            Calculate_plan()
        },


    });
    var active_plan = 0;
    var active_coin = "Bitcoin";
    var active_coin_s = "BTC";

    function selectPlan(num) {
        let plan = document.querySelectorAll('.step__staking-button')
        plan.forEach(el => {
            el.classList.remove('active')
        });
        plan[num - 1].classList.add('active')
        active_plan = num;

        Calculate_plan()
    }
    available_balance_func(189, "BTC")
    function available_balance_func(id_coin, text) {
        $.ajax({
            type: "POST",
            url: "/api/ajax/get_balance_coin.php",
            data: {
                coin: id_coin
            },
            success: function(response) {

                if (response.status == 'success') {
                    const balance = parseFloat(response.balance);

                    const available_balance = document.getElementById('available_balance');

                    available_balance.innerHTML = `Available: <span id="available_balance_value">${balance.toFixed(1)}</span> ${text}`;
                }
            },
            error: function(response) {
                console.log(response)
            }
        });
    }
    

    function input_value_all_balance() {
        const available_balance_value = document.getElementById('available_balance_value').textContent;
        const input_amount_element = document.getElementById('input_amount');
        input_amount_element.value = available_balance_value;
        Calculate_plan()
    }

    function Calculate_plan() {
        const input_amount_element = document.getElementById('input_amount');
        const input_amount_element_text = document.getElementById('input_amount').value;
        const input_amount = parseFloat(input_amount_element.value);
        const available_balance_value = document.getElementById('available_balance_value').textContent;
        const available_balance = parseFloat(available_balance_value);
        if (input_amount > available_balance) {
            input_amount_element.value = available_balance;
        }
        const plan = active_plan;
        const percent = [1.3, 1.6, 2.1, 2.6];
        const days = [7, 14, 30, 90];
        const profit = input_amount * percent[plan - 1] / 100 * days[plan - 1];
        const profit_element = document.getElementById('profit_coin');
        const profit_usd_element = document.getElementById('profit_coin_usd');
        const profit_element_total = document.getElementById('profit_coin_total');
        const profit_usd_element_total = document.getElementById('profit_coin_usd_total');
        if (input_amount_element_text != "" && plan != 0) {
            $.ajax({
                type: "POST",
                url: "/api/ajax/get_price_coin.php",
                data: {
                    coin_name: active_coin
                },
                success: function(response) {

                    if (response.status == 'success') {
                        const course = response.course;

                        profit_element.textContent = profit.toFixed(5) + active_coin_s;
                        profit_usd_element.textContent = "~ " + (profit * course).toFixed(2) + "$";
                        profit_element_total.textContent = (profit + input_amount).toFixed(5) + active_coin_s;
                        profit_usd_element_total.textContent = "~ " + ((profit + input_amount) * course).toFixed(2) + "$";
                    }
                },
                error: function(response) {
                    console.log(response)
                }
            });
        }

    }
    function create_staking_order(){
        const input_amount_element = document.getElementById('input_amount');
        const input_amount_element_text = document.getElementById('input_amount').value;
        const input_amount = parseFloat(input_amount_element.value);
        const available_balance_value = document.getElementById('available_balance_value').textContent;
        const available_balance = parseFloat(available_balance_value);
        if (input_amount > available_balance) {
            input_amount_element.value = available_balance;
        }
        const plan = active_plan;
        const percent = [1.3, 1.6, 2.1, 2.6];
        const days = [7, 14, 30, 90];
        const profit = input_amount * percent[plan - 1] / 100 * days[plan - 1];
        const profit_element = document.getElementById('profit_coin');
        const profit_usd_element = document.getElementById('profit_coin_usd');
        const profit_element_total = document.getElementById('profit_coin_total');
        const profit_usd_element_total = document.getElementById('profit_coin_usd_total');
        if (input_amount_element_text != "" && plan != 0) {
            $.ajax({
                type: "POST",
                url: "/api/ajax/create_staking_order.php",
                data: {
                    coin_name: active_coin,
                    summ_coin: input_amount,
                    profit: profit,
                    days: days[plan - 1]
                },
                success: function(response) {

                    if (response.status == 'success') {
                        new Notify({
                        title: 'Success',
                        text: 'Order successfully created',
                        status: 'success',
                        autoclose: true,
                        autotimeout: 1000
                    })
                    setTimeout(() => {
                        location.reload();
                    }, 1000);
                        
                    }
                    else{
                        new Notify({
                        title: 'Error',
                        text: "Server Error",
                        status: 'error',
                        autoclose: true,
                        autotimeout: 3000
                    })
                    
                    }
                },
                error: function(response) {
                    console.log(response)
                }
            });

        }
    }

    function cancelStakingOrder(id){
        $.ajax({
            type: "POST",
            url: "/api/ajax/cancel_staking_order.php",
            data: {
                id: id
            },
            success: function(response) {

                if (response.status == 'success') {
                        new Notify({
                        title: 'Success',
                        text: 'Order successfully cancelled',
                        status: 'success',
                        autoclose: true,
                        autotimeout: 1000
                    })
                    setTimeout(() => {
                        location.reload();
                    }, 1000);
                        
                    }
                    else{
                        new Notify({
                        title: 'Error',
                        text: "Server Error",
                        status: 'error',
                        autoclose: true,
                        autotimeout: 3000
                    })
                    
                    }
            },
            error: function(response) {
                console.log(response)
            }
        });
    }
</script>

